Actionscript.script:
stop();

jouer_bt.addEventListener(MouseEvent.CLICK,clicMenuInitial);
generique_bt.addEventListener(MouseEvent.CLICK,clicMenuInitial);

function clicMenuInitial(e:MouseEvent):void{
	//selon le bouton, on se deplace vers un autre frame
	switch (e.currentTarget.name) {
		case "jouer_bt": if(!e.ctrlKey){gotoAndStop("animDebut");}else{gotoAndStop("jeu");} break;
		case "generique_bt": gotoAndStop("generique"); break;
	}
}

addEventListener(Event.REMOVED_FROM_STAGE, nettoyer);

function nettoyer(e:Event):void{
	jouer_bt.removeEventListener(MouseEvent.CLICK,clicMenuInitial);
	generique_bt.removeEventListener(MouseEvent.CLICK,clicMenuInitial);
}

import flash.media.SoundMixer;

retour_bt.addEventListener(MouseEvent.CLICK,clicRetour);

function clicRetour(e:MouseEvent):void{
	SoundMixer.stopAll(); // l'arrêt du son prévient un bogue de Animate avec le framerate
	gotoAndStop("menuInitial");
}

addEventListener(Event.REMOVED_FROM_STAGE, enleveBtRetour);

function enleveBtRetour(e:Event):void{
	retour_bt.removeEventListener(MouseEvent.CLICK,clicRetour);
}
